import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";

const FinalPage = () => {
  const location = useLocation();
  const fileData = location.state;

  const { reportName } = location.state;

  const [data, setData] = useState({
    dimensions: [],
    metric: null,
    refreshTime: "",
    queryResults: null,
  });

  const metricAliases = {
    totalUsers: "total_users",
    revenue: "total_revenue",
    eventCount: "total_events",
    views: "total_views",
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch the JSON file from Cloud Storage
        const response = await fetch(
          `http://localhost:3001/get-file-by-report-name/${reportName}`
        );
        const fileData = await response.json();

        // Extract parameters from the fileData
        const dimensions = fileData.dimensions || [];
        const metric = fileData.metric || null;
        const refreshTime = fileData.refreshTime || "";
        const timestamp = fileData.timestamp || null; // Get the timestamp from the file

        if (timestamp) {
          const savedTime = new Date(timestamp);
          const currentTime = new Date();
          const refreshTimeInMinutes = parseInt(refreshTime.split(" ")[0]); // Extract minutes from refreshTime
          const timeDifference = (currentTime - savedTime) / (1000 * 60); // Difference in minutes

          if (timeDifference <= refreshTimeInMinutes) {
            // Data is still fresh, use it directly
            setQueryResults(fileData.results || null);
            setDimensions(dimensions);
            setMetric(metric);
            return; // No need to fetch from BigQuery
          }
        }

        // Fetch data from BigQuery using the extracted parameters
        const bqResponse = await fetch("http://localhost:3001/query-bigquery", {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({
            dimensions,
            metric,
            refreshTime,
          }),
        });

        const bigqueryData = await bqResponse.json();

        // Update the state with the fetched data and other details
        setData({
          dimensions,
          metric,
          refreshTime,
          queryResults: bigqueryData,
        });
      } catch (error) {
        console.error("Error fetching data:", error);
        // Handle error appropriately
      }
    };

    fetchData();
  }, [reportName]); // Re-fetch if reportName changes

  return (
    <div>
      <h1>Final Page</h1>
      <h2>{fileData.reportName}'s Report</h2>
      <h2>Query Results:</h2>
      {data.queryResults && data.queryResults.length > 0 ? (
        <table>
          <thead>
            <tr>
              {/* Dynamically create table headers */}
              {data.dimensions.map((dimension) => (
                <th key={dimension}>{dimension}</th>
              ))}
              <th>{metricAliases[data.metric]}</th>
            </tr>
          </thead>
          <tbody>
            {data.queryResults.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {/* Dynamically render table cells */}
                {data.dimensions.map((dimension) => (
                  <td key={`${rowIndex}-${dimension}`}>{row[dimension]}</td>
                ))}
                <td>{row[metricAliases[data.metric]]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>{data.queryResults ? "No data found." : "Loading data..."}</p>
      )}
    </div>
  );
};

export default FinalPage;
